import { VideoList } from "./components/VideoList";
const videos = [
  {
    name: "video of me",
    duration: "15 min",
    id: 1,
  },
  {
    name: "video of me",
    duration: "15 min",
    id: 2,
  },
];

function App() {
  return (
    <>
      <h1>
        hello gaus, i gonna sow you <p>{videos.name}</p>
      </h1>
      <VideoList />
    </>
  );
}

export default App;
